import React from 'react';
import './App.css';


function App() {
  return (
    <div className="app-wrapper">
      <header className="header">
        <img src="https://lh3.googleusercontent.com/proxy/YQXwWfcvT6D7EzwDTEgyJ2LFhxyiKxVkW6msjExj8x8FO2duy4QFMunUFBpz82-1XnwqPxKUNEnGSrtaGTGY5qWrxpWMCXzrPl6-3t8gpXj7cx-ReD2ZIQ"></img>
      </header>
      <nav className="nav">
        <div>Profile</div>
        <div>Message</div>
      </nav>
      <div className="content">
        Content
        </div>
    </div>
  );
}

export default App;
